), sedangkan untuk wilayah Lampung terdapat 24 POI yang meliputi Bandar Udara, Terminal Bus, Stasiun Kereta, Dermaga, Rumah Sakit, Area Padat Populasi, Pasar Tradisional, dan Mal, di mana lokasi-lokasi tersebut diprediksi akan mengalami lonjakan komunikasi yang cukup tinggi di masa Ramadhan dan Lebaran.
Selain itu seluruh channel pelayanan existing Telkomsel yang berada diwilayah Regional Sumbagsel, juga diharapkan dapat berfungsi maksimal selama Ramadhan dan Lebaran, di antaranya 43 GraPARI, 60 Mobile GraPARI, 4unit layanan digital self-service MyGraPARI, dan 73 Branch Office (Telkomsel Distribution Center).
Selain kesiapan jaringan dan layanan, pada bulan Ramadhan ini Telkomsel juga mengadakan serangkaian kegiatan sosial, yakni buka puasa bersama 2500 anak Negeri se Sumatera yang merupakan bagian dari 10.000 anak negeri secara nasional.(W01)
